import { useForm } from "react-hook-form";
import React from "react";
import { Link } from "react-router-dom";

const Browse = () => {
    const paperStyle={color: blue, padding: '50px 20px', width:300, margin:"20px auto"}
    return(
        <div className="browse">
            <h2>Webform Collection</h2>
            <h5>Browse our entire library of user-generated webforms.</h5>
            <br /><Link to="/">
                <button style={paperStyle}>Go Back</button>
                </Link>
        </div>
        
    );
}

export default Browse
